När man får gäster över på middag lite oväntat så är det bra att kunna göra en snabb men försvinnande god dessert!

Jag har använt:
(6 portioner)
3 dl grädde
300 gram Philadelphia 
1 dl blåbär (plus några till topping)
1 tsk vaniljsocker
1,5 dl florsocker 
6-8 degistive kex 

GÖR SÅHÄR:
